const images = [
  { id: 1, src: './images/anna1.jpg', title: 'foo', description: 'bar' },
  { id: 2, src: './images/anna2.jpg', title: 'foo', description: 'bar' },
  { id: 3, src: './images/anna3.jpg', title: 'foo', description: 'bar' },
  { id: 4, src: './images/anna4.jpg', title: 'foo', description: 'bar' },
  { id: 5, src: './images/anna5.jpg', title: 'foo', description: 'bar' },
];

export default images;
